import React from "react";
import styled from "styled-components";
import { Tab } from 'semantic-ui-react'


const Frame = styled.iframe`
    margin: 20px auto;

`;

const Styling = styled.div `
    background-color: #b5bcbe;
    margin: 20px auto 20px auto;
    border-top: 4px solid black;


`;


const panes = [
    { menuItem: 'Eagles Stats', render: () => <Tab.Pane><Frame id="n_1" src="https://www.numberfire.com/external/widgets/teams/philadelphia-eagles" width="480" height="400"></Frame></Tab.Pane> },
    { menuItem: 'Top Player Projections', render: () => <Tab.Pane><Frame id="n_0" src="https://www.numberfire.com/external/widgets/top-players" width="480" height="400"></Frame></Tab.Pane> },
    { menuItem: 'Tab 3', render: () => <Tab.Pane>Tab 3 Content</Tab.Pane> },
  ]

function Football () {


    return (
        <>
        <Styling>
        <Tab panes={panes} />
        </Styling>
        </>
    )

}

export default Football;
